import styled from 'styled-components';

export const ProductList = styled.li`
  display: grid;
  git-template-columns: repeat(3, 1fr);
  grid-gap: 20px;
  list-style: none;

  ul{
    display: flex;
    flex-direction:column;
    background: #FFF;
    border-radius: 4px;
    padding: 20px;

    img{
      align-self: center;
      max-width: 250px;
    }
  }
`;
